      const start = predictions[i].topLeft;
      const end = predictions[i].bottomRight;
      const size = [end[0] - start[0], end[1] - start[1]];
      tx.fillStyle = "rgba(255, 0, 0, 0.5)";
      ctx.fillRect(start[0], start[1], size[0], size[1]);
      */
      if (annotateBoxes) {
        const landmarks = predictions[i].landmarks;

        ctx.fillStyle = "blue";
        for (let j = 0; j < landmarks.length; j++) {
          const x = landmarks[j][0];
          const y = landmarks[j][1];
          ctx.fillRect(x, y, 5, 5);
        }
      var up = false;
      var down = false;
      var left = false;
      var right = false;
      var Status = [];

      //var p_state = localStorage.getItem(status);
      //console.log("Previous Status",p_state)
      if (landmarks[4][1] < landmarks[0][1] && landmarks[5][1] < landmarks[1][1])
        {
          down = true ;
          if (!(State.p_state.includes('down')))

            {
              //.log("Position Changed")
              Status.push("down");
            }

        }
      if (landmarks[4][1] > landmarks[0][1] && landmarks[5][1] > landmarks[1][1])
      {
        up = true;
        if (!(State.p_state.includes('up')))

          {
            //console.log("Position Changed")
            Status.push("up")
          }

      }
      if (landmarks[4][0] < landmarks[0][0] || (landmarks[4][0] - landmarks[0][0]<10))
        //|| (landmarks[0][0] - landmarks[4][0]<10)
      {
        right = true;
        if (!(State.p_state.includes('right')))

          {
            console.log("Position Changed")
            Status.push("right");
          }

      }
      if (landmarks[1][0] < landmarks[5][0] || (landmarks[1][0] - landmarks[5][0]<10))
        //|| (landmarks[5][0] - landmarks[1][0]<10)
      {
        left = true;
        if (!(State.p_state.includes('left')))
          {
            console.log("Position Changed")
            Status.push("left")
          }

      }
      if (Status.length!=0)
      {
        if (!(State.p_state.includes(Status)))
        console.log("Position Changed")
        console.log(State.p_state,Status)
        State.p_state = Status
        document.getElementById("status").innerText = State.p_state;
      }

      // p_state = localStorage.setItem(status)
    }

      }
  }

  stats.end();

  requestAnimationFrame(renderPrediction);
};

const setupPage = async () => {
  await tf.setBackend(state.backend);
  await setupCamera();
  video.play();

  videoWidth = video.videoWidth;
  videoHeight = video.videoHeight;
  video.width = videoWidth;
  video.height = videoHeight;

  canvas = document.getElementById('output');
  canvas.width = videoWidth;
